import React from 'react';
import { useTranslation } from 'react-i18next';

const Home = () => {
  const { t } = useTranslation();

  return (
    <div className="min-h-screen bg-white flex items-center justify-center">
      <div className="text-center px-6">
        {/* Logo or Header */}
        <div className="mb-8">
          <h1 className="text-4xl font-bold text-blue-600">{t('welcome_message')}</h1>
        </div>

        {/* Content */}
        <p className="text-lg text-gray-700 mb-6">
          {t('home_description')}
        </p>

        {/* Example content blocks */}
        <div className="grid gap-6 grid-cols-1 md:grid-cols-2 max-w-3xl mx-auto">
          <div className="p-6 border rounded-lg shadow hover:shadow-md transition">
            <h2 className="text-xl font-semibold text-blue-500 mb-2">{t('tutorials')}</h2>
            <p className="text-gray-600">{t('tutorials_desc')}</p>
          </div>

          <div className="p-6 border rounded-lg shadow hover:shadow-md transition">
            <h2 className="text-xl font-semibold text-green-500 mb-2">{t('bookings')}</h2>
            <p className="text-gray-600">{t('bookings_desc')}</p>
          </div>

          <div className="p-6 border rounded-lg shadow hover:shadow-md transition">
            <h2 className="text-xl font-semibold text-purple-500 mb-2">{t('reminders')}</h2>
            <p className="text-gray-600">{t('reminders_desc')}</p>
          </div>

          <div className="p-6 border rounded-lg shadow hover:shadow-md transition">
            <h2 className="text-xl font-semibold text-yellow-600 mb-2">{t('notifications')}</h2>
            <p className="text-gray-600">{t('notifications_desc')}</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
